import React from "react";
import Question from "./FAQs1";

function FAQPage() {
  const questions = [
    { question: "", answer: "React is a JavaScript library for building user interfaces." },
    { question: "Why use React?", answer: "React makes it easier to create interactive UIs." },
    { question: "What is a component?", answer: "A component is a reusable piece of UI in React." },
    { question: "What is JSX?", answer: "JSX is a syntax extension for JavaScript used in React." },
    { question: "What is state in React?", answer: "State is an object that determines the behavior of a component." },
    { question: "What are props?", answer: "Props are inputs to components passed as attributes." },
  ];

  return (
    <div className="min-h-screen bg-blue-100 p-8">
      <h1 className="text-2xl font-bold text-center mb-6  text-blue-600">Frequently Asked Questions</h1>
      <div className="max-w-md mx-auto bg-white rounded-lg shadow-lg p-4">
        {questions.map((q, index) => (
          <Question key={index} question={q.question} answer={q.answer} />
        ))}
      </div>
    </div>
  );
}

export default FAQPage;
